import React from 'react';

const SettingsButton = ({ onClick }) => {
  return (
    <button className="btn btn-primary" onClick={onClick} style={{ backgroundColor: '#ebebeb' }}>
      comenzar
    </button>
  );
};

export default SettingsButton;
